// SPDX-License-Identifier: MIT

pragma solidity ^0.8.18;

import "@openzeppelin/contracts/access/Ownable.sol";

contract MyProfile is Ownable {
    struct Post {
        uint64 created;
        // the index where post is placed in orderedPosts list
        uint index;
    }

    // postCID => Post
    mapping(string => Post) private posts;

    string[] private orderedPosts;

    function addPost(string memory _postCID, uint64 _created) public onlyOwner {
        require(posts[_postCID].created == 0, "the post with pass CID is already present");
        require(_created > 0, "_created time should be > 0");

        posts[_postCID] = Post({created: _created, index: orderedPosts.length});
        // save new post to array to get all posts after
        orderedPosts.push(_postCID);
    }

    function getPost(string memory _postCID) public view returns (Post memory) {
        return posts[_postCID];
    }

    /*
    Replace post CID with new CID
    */
    function editPost(string memory _oldPostCID, string memory _newPostCID) public onlyOwner {
        // copy old post data to new (edited) post
        posts[_newPostCID] = posts[_oldPostCID];
        // replace old post CID with new CID
        orderedPosts[posts[_oldPostCID].index] = _newPostCID;
        // remove old post data
        delete posts[_oldPostCID];
    }

    /*
    Return paginated posts result
     */
    function getPosts(uint _start, uint _end) public view returns (string[] memory, uint) {
        require(_start >= 0 && _start < _end, "_start should be >= 0 and < _end");
        require(_end - _start <= 100, "different between _end and _start cannot be > 100");

        uint _totalNumberPosts = orderedPosts.length;
        uint _allowableEnd;

        if (_end > _totalNumberPosts) {
            _allowableEnd = _totalNumberPosts;
        } else {
            _allowableEnd = _end;
        }

        uint _currentNumberPosts = _allowableEnd - _start;

        string[] memory _list = new string[](_currentNumberPosts);

        for (uint i = 0; i < _currentNumberPosts; i++) {
            _list[i] = orderedPosts[_start + i];
        }

        return (_list, _totalNumberPosts);
    }
}
